import { Grid2 as Grid, Typography, ThemeProvider, Button } from '@mui/material';
import Logo from '../../assets/logo.png';
import Image from './Image';

export default function HomepageHeader() {
    
    return (
        <Grid container
            sx = {{
                width: "100%",
                height: "60px",
                display: "flex",
                flexDirection: "row",
            }}
        >
            <Grid item md={2} xs={2} sx = {{padding: "1em 1.5em", boxSizing: "border-box"}}>
                <Image src ={Logo} sx={{ width: "120px"}}/>
            </Grid>
            <Grid container item md={10} xs={10}
                sx = {{
                    display: "flex",
                    flexDirection: "row",
                    height: "60px",
                    border: "1px solid #433D44"
                }}
            >
                <Button>
                    web development
                </Button>
                <Button>
                    graphic design
                </Button>
                <Button>
                    about me
                </Button>
            </Grid>
        </Grid>
    )
}
